import React from "react";
import NewNote from './NewNote';
import Note from "./Note";
import notesData from "../../notes-data";

function createNote(note) {
    return <Note
        key={note.id}
        noteHeader={note.h}
        noteContent={note.p}
    />
}

function Notes() {
  return (
    <div>

        {notesData.map(createNote)}
    </div>
  );
}

export default Notes;
